var CameraColorSelector=0;

function ButtonHelpInfo(ButtonNumber)
{
  CameraColorSelector++;
  CameraColorSelector=CameraColorSelector%TransitPolyLinesColor.length;

  $('#div-console-data').append('<br/>-----( ButtonHelpInfo )---------> '+ CameraColorSelector+'--> '+ TransitPolyLinesColor[CameraColorSelector]);
  $("#div-console-data").css("color", TransitPolyLinesColor[CameraColorSelector]);
  $(".div-toolbar-footer-breadcrumbs").css("color", TransitPolyLinesColor[CameraColorSelector]);
}

function RefreshCamera(id,img)
{
  //alert('RefreshCamera');
  cameraHTML=document.getElementById("camera"+id);
  if (cameraHTML!=null)
  {
    cameraHTML.src=img;

  }
}

/**
@function createMarkerCamera
@memberof Gama-Editor
@param {google.maps.LatLng} point
@param {string} ime
@param {integer} vrednost
@param {MIME} slika
@param {object} datura
*/

function createMarkerCamera(id, point, ime, vrednost, slika, description)
{
                // This example displays a marker.
                // When the user clicks the marker, an info window opens.
                  var imgWidth=Math.ceil(1182*(0.50));
                  var imgHeight=Math.ceil(470*(0.50));

                  if (vrednost==0)
                  {
                    imgWidth=Math.ceil(821*0.7);
                    imgHeight=Math.ceil(660*0.7);
                  }

                  var contentString='';
                  contentString+='<h2>'+ime+'</h2><br/>';
                  contentString+='<br/><img id="camera'+id+'" class="img-gama" src="'+slika+'" width="'+imgWidth+'" height="'+imgHeight+'"/><br/>';
                  contentString+='<b>'+description+'</b><br/>';
                  contentString+="<a href=\"http://www.dars.si/Vsebina/kamere.aspx\" target=\"_blank\">DARS</a>";

                  //setTimeout(RefreshCamera(id,slika),10000);
                  var infowindow = new google.maps.InfoWindow({
                    content: contentString
                  });

          /**@inner*/
          var CameraSymbol;
          CameraSymbol = {
            url: './images/camera-icon.png',
            // This marker is 20 pixels wide by 32 pixels high.
            size: new google.maps.Size(55, 33),
            // The origin for this image is (0, 0).
            origin: new google.maps.Point(0, 0),
            // The anchor for this image is the base of the flagpole at (0, 32).
            anchor: new google.maps.Point(27, 22)
          };

                  var marker = new google.maps.Marker({
                    position: point,
                    icon: CameraSymbol,
                    map: map,
                    title: ime
                  });

                  marker.addListener('click', function() {
                    infowindow.open(map, marker);

                  });

                  CameraInfoWindow[vrednost]=infowindow;

        return marker;
}


